        <p style="margin-left: 20px !important; text-align: justify;" data-mce-style="text-align: justify;">6.1 O não pagamento de qualquer parcela acima ajustado na data prevista caracterizará a mora da <strong>CONTRATANTE</strong> e, implicará no vencimento antecipado da dívida, independente de qualquer notificação do <strong>CONTRATANTE</strong>, com a incidência de multa de 2% (dois por cento), sobre a dívida original, acrescido de juros à taxa de 1% (um por cento) ao mês, bem como atualização monetária pelo INPC - Índice Nacional Preço ao Consumidor, além das despesas judiciais e dos honorários advocatórios aqui estabelecidos entre as partes em 20% (vinte por cento), a serem pagos pela <strong>CONTRATANTE.</strong> </p>
