        <tr>
        <td>
        <p style="margin-left: 20px !important; text-align: justify;" data-mce-style="text-align: justify;">6.2 O presente instrumento poderá ser rescindido a qualquer tempo, desde que seja expressamente notificada a outra parte com 30 (trinta) dias de antecedência, sem prejuízo de aplicação das multas previstas nos itens seguintes. </p>
