        <tr>
        <td>
        <p style="margin-left: 20px !important; text-align: justify;" data-mce-style="text-align: justify;">9.1 A CONTRATADA, por si e por seus colaboradores, obriga- se a atuar no presente Contrato em conformidade com a Legislação vigente sobre Proteção de Dados Pessoais e as determinações de órgãos reguladores/fiscalizadores sobre a matéria, em especial a Lei 13.709/2018, além das demais normas e políticas de proteção de dados de cada país onde houver qualquer tipo de tratamento dos dados dos clientes, o que inclui os dados dos clientes desta. No manuseio dos dados a CONTRATADA deverá:</p>
        </td>
        </tr>

        <tr>
        <td>
        <p style="margin-left: 40px !important; text-align: justify;" data-mce-style="text-align: justify;">9.1.1 Tratar os dados pessoais a que tiver acesso apenas de acordo com as instruções da CONTRATANTE e em conformidade com estas cláusulas, e que, na eventualidade, de não mais poder cumprir estas obrigações, por qualquer razão, concorda em informar de modo formal este fato imediatamente à CONTRATANTE.</p>
