        <tr>
        <td>
        <p style="margin-left: 40px !important; text-align: justify;" data-mce-style="text-align: justify;">9.1.2 Manter e utilizar medidas de segurança administrativas, técnicas e físicas apropriadas e suficientes para proteger a confidencialidade e integridade de todos os dados pessoais mantidos ou consultados/transmitidos eletronicamente, para garantir a proteção desses dados contra acesso não autorizado, destruição, uso, modificação, divulgação ou perda acidental ou indevida.</p>
        </td>
        </tr>

        <tr>
        <td>
        <p style="margin-left: 40px !important; text-align: justify;" data-mce-style="text-align: justify;">9.1.3 Acessar os dados dentro de seu escopo e na medida abrangida por sua permissão de acesso (autorização) e que os dados pessoais não podem ser lidos, copiados, modificados ou removidos sem autorização expressa e por escrito da CONTRATANTE.</p>
        </td>
        </tr>

        <tr>
        <td>
        <p style="margin-left: 40px !important; text-align: justify;" data-mce-style="text-align: justify;">9.1.4 Garantir, por si própria ou quaisquer de seus empregados, prepostos, sócios, diretores, representantes ou terceiros contratados, a confidencialidade dos dados processados, assegurando que todos estes que lidam com os dados pessoais sob responsabilidade da CONTRATANTE, assinaram Acordo de Confidencialidade com a CONTRATADA, bem como a manter quaisquer Dados Pessoais estritamente confidenciais e de não utilizá-los para outros fins, salvo para a fiel execução do objeto do contrato de prestação de serviço.</p>
        </td>
        </tr>

        <tr>
        <td>
        <p style="margin-left: 40px !important; text-align: justify;" data-mce-style="text-align: justify;">9.1.5 A CONTRATADA em nenhuma hipótese repassará a terceiros informações relativas ao contrato de prestação de serviço firmado com a CONTRATANTE, salvo mediante requerimento expresso da CONTRATANTE, cuja autorização deverá, obrigatoriamente, conter o destinatário e os dados que serão objeto de compartilhamento.</p>
        </td>
        </tr>

        <tr>
        <td>
        <p style="margin-left: 40px !important; text-align: justify;" data-mce-style="text-align: justify;">9.1.6 A CONTRATADA esclarece que os dados pessoais da CONTRATANTE ficarão em sua base de dados pelo período compreendido entre a data da assinatura do contrato, até 24 (vinte e quatro) meses após a entrega do produto/serviço contratado. Após essa data, todos os dados da CONTRATANTE serão destruídos/deletados do seu servidor; em caso de documento físico, estes serão, igualmente, destruídos.  </p>
